import React from "react";

const SubmissionButtons = () => {
  return (
    <div className="mt-5">
      <button className="border rounded-lg bg-green-500 px-4">Submit</button>
      <button className="border rounded-lg bg-gray-500">Run</button>
    </div>
  );
};

export default SubmissionButtons;
